import { useEffect, useState } from 'react'

function basicSerialize<T>(value: T): string {
    if (typeof value === 'object') {
        return JSON.stringify(value)
    }
    return String(value)
}

export function useLocalStorageState<T>(
    key: string,
    defaultValue: T,
    options?: {
        serialize?: (value: T) => string
        deserialize?: (value: string) => T
    },
) {
    const reactState = useState<T>(() => {
        const savedValue = localStorage.getItem(key)
        if (savedValue !== null) {
            if (options?.deserialize) {
                return options.deserialize(savedValue)
            }
            return savedValue as T // Assuming T is a string
        }
        return defaultValue
    })

    const [state] = reactState

    useEffect(() => {
        const serializedState =
            options?.serialize?.(state) || basicSerialize(state)
        localStorage.setItem(key, serializedState)
    }, [state, key, options])

    return reactState
}

import { MutableRefObject, useEffect, useRef } from "react";

export function useModalRef(
  open: boolean,
  closeOnOutsideClick?: boolean,
  allowCancel?: boolean
): MutableRefObject<HTMLDialogElement | null> {
  const ref = useRef<HTMLDialogElement | null>(null);

  let reopen = async () => {
    // We do this in a timeout so it runs after the modal has actually closed.
    setTimeout(() => ref.current?.showModal());
  };

  useEffect(() => {
    if (open) {
      if (ref.current && !ref.current?.open) {
        ref.current?.showModal();
        if (allowCancel !== undefined && !allowCancel) {
          ref.current?.addEventListener("cancel", reopen);
        }
      }
      if (closeOnOutsideClick) {
        const handleClickOutside = (e: MouseEvent) => {
          const target = e.target as HTMLDialogElement | null;
          if (!target) return;

          const { top, left, width, height } = target.getBoundingClientRect();
          const clickedInDialog =
            top <= e.clientY &&
            e.clientY <= top + height &&
            left <= e.clientX &&
            e.clientX <= left + width;

          if (!clickedInDialog) {
            target.close();
          }
        };

        document.addEventListener("mousedown", handleClickOutside);
        return () => {
          document.removeEventListener("mousedown", handleClickOutside);
        };
      }
    } else {
      ref.current?.close();
      ref.current?.removeEventListener("cancel", reopen);
    }
  }, [open, closeOnOutsideClick]);

  return ref;
}

