enum Mods {
    LeftControl = 0x01,
    LeftShift = 0x02,
    LeftAlt = 0x04,
    LeftGUI = 0x08,
    RightControl = 0x10,
    RightShift = 0x20,
    RightAlt = 0x40,
    RightGUI = 0x80,

}

const mod_labels: Record<Mods, string> = {
    [Mods.LeftControl]: 'L Ctrl',
    [Mods.LeftShift]: 'L Shift',
    [Mods.LeftAlt]: 'L Alt',
    [Mods.LeftGUI]: 'L GUI',
    [Mods.RightControl]: 'R Ctrl',
    [Mods.RightShift]: 'R Shift',
    [Mods.RightAlt]: 'R Alt',
    [Mods.RightGUI]: 'R GUI',
}

const all_mods = [
    Mods.LeftControl,
    Mods.LeftShift,
    Mods.LeftAlt,
    Mods.LeftGUI,
    Mods.RightControl,
    Mods.RightShift,
    Mods.RightAlt,
    Mods.RightGUI,
]

function mods_to_flags(mods: Mods[]): number {
    return mods.reduce((a, v) => a + v, 0)
}

function mask_mods(value: number) {
    console.log(value & ~(mods_to_flags(all_mods) << 24))
    return value & ~(mods_to_flags(all_mods) << 24)
}

export const HidUsagePicker = ({
    label,
    value,
    usagePages,
    onValueChanged,
}: HidUsagePickerProps) => {
    const mods = useMemo(() => {
        const flags = value ? value >> 24 : 0

        return all_mods.filter((m) => m & flags).map((m) => m.toLocaleString())
    }, [value])
    const selectionChanged = useCallback(
        (e: Key | null) => {
			let value = typeof e == 'number' ? e : undefined
            if (value !== undefined) {
                const mod_flags = mods_to_flags(mods.map((m) => parseInt(m)))
                value = value | (mod_flags << 24)
            }

            console.log(value)
            onValueChanged(value)
        },
        [onValueChanged, mods],
    )

    const modifiersChanged = useCallback(
        (m: string[]) => {
            if (!value) {
                return
            }

            const mod_flags = mods_to_flags(m.map((m) => parseInt(m)))
            const new_value = mask_mods(value) | (mod_flags << 24)
            console.log(new_value)
            onValueChanged(new_value)
        },
        [value],
    )

    return (
        <div className="flex gap-2 relative">
            {label && <Label id="hid-usage-picker">{label}:</Label>}
            <ComboBox
                selectedKey={value ? mask_mods(value) : null}
                onSelectionChange={selectionChanged}
                aria-labelledby="hid-usage-picker"
            >

import { BehaviorParameterValueDescription } from '@zmkfirmware/zmk-studio-ts-client/behaviors'
import { hidUsagePageAndIdFromUsage } from '../helpers/hid-usages.ts'

export function validateValue(
    layerIds: number[],
    value?: number,
    values?: BehaviorParameterValueDescription[],
): boolean {
    if (value === undefined) {
        return values === undefined || values?.length === 0 || !!values[0].nil
    }
    // console.log(values,value,layerIds)
    const matchingValue = values?.find((v) => {
        if (v.constant !== undefined) {
            return v.constant == value
        } else if (v.range) {
            return value >= v.range.min && value <= v.range.max
        } else if (v.hidUsage) {
            const [page, id] = hidUsagePageAndIdFromUsage(value)
            return page !== 0 && id !== 0
        } else if (v.layerId) {
            return layerIds.includes(value)
        } else if (v.nil) {
            return value === 0
        } else {
            console.error('Unknown check type!')
            return false
        }
    })

    return !!matchingValue || (value === 0 && (!values || values.length === 0))
}

